import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Offcanvas from 'react-bootstrap/Offcanvas';
import React, {useState} from 'react'

import '../App.css'
function OffcanvasExample() {
const [activeLink, setActiveLink] = useState("Shop")

  return (
    <>
      {['sm'].map((expand) => (
        <Navbar key={expand}  expand={expand}  >
          <Container fluid>
            <Navbar.Brand ></Navbar.Brand>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} 
          />
            <Navbar.Offcanvas 
        style={{backgroundColor:'#f7ac99'}}
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="top"
              className='h-100 text-center'
            >
              <Offcanvas.Header closeButton >
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}></Offcanvas.Title>
              </Offcanvas.Header>
              <Offcanvas.Body >
              <Nav className="ms-auto mt-2  fw-bolder"
               defaultActiveKey={activeLink}
               onSelect={(selectedKey, event) => {
                 event.preventDefault();
                 console.log("selected key is: ", selectedKey);
                 setActiveLink(selectedKey);
               }} >
              
                  <Nav.Link href="/Shop" eventKey="Shop">
                    Shop
                  </Nav.Link>
                 
                  <Nav.Link className="mx-2 nav-link" href="/commission" eventKey="/commission">
                    Commissions
                  </Nav.Link>
                  <Nav.Link className="mx-2 " href="/delivery"eventKey="delivery">
                    Delivery
                  </Nav.Link>
                  <Nav.Link className="mx-2" href="/About" eventKey="About">
                    About
                  </Nav.Link>
                  <Nav.Link className="mx-2" href="/Contacts" eventKey="Contacts">
                    Contacts
                  </Nav.Link>
                </Nav>
                <Nav className="  fw-bolder  mx-5">
                  <Nav.Link className="me-3 " href="/guide">
                    <Button
                      style={{
                        backgroundColor: "#ffcc00",
                        border: "none",
                        borderRadius: "0rem",
                        width: "8.6rem",
                        height: "2.5rem",
                        fontSize: "0.91em",
                        fontWeight: "bold",
                        
                      }}
                      className="fw-bold text-white"
                    >
                      Buy e-guide
                    </Button>
                  </Nav.Link>
                  <Nav.Link className="me-1 mt-2" href="/english" eventKey="english">
                    English
                  </Nav.Link>
                  <Nav.Link className="mt-2" href="/pyccknn" eventKey="pyccknn">
                    Русский
                  </Nav.Link>
                </Nav>
                
                
              </Offcanvas.Body>
            </Navbar.Offcanvas>
          </Container>
        </Navbar>
      ))}
    </>
  );
}

export default OffcanvasExample;
